CREATE DEFINER=`skybots`@`localhost` FUNCTION `function_valida_cep` (`Nr_Cep` VARCHAR(8)) RETURNS BIT(1) BEGIN
-- Finalidade..............: Function para validar o CEP (tamanho e se possui somente números)
-- OBS.....................: A entrada é um varchar e o retorno é um bit, 1 para válido, 0 para inválido
DECLARE chr CHAR;
declare tamanho INT;
    
    -- Verifica se possui 8 caracteres
    IF (LENgth(Nr_Cep) < 8) then
        RETURN 0;
	end if;
    
    -- Verifica se não são dígitos repetidos.
    IF ((Nr_Cep = "11111111") OR (Nr_Cep = "22222222") OR (Nr_Cep = "33333333") OR (Nr_Cep = "44444444") OR (Nr_Cep = "55555555") OR (Nr_Cep = "66666666") OR (Nr_Cep = "77777777") OR (Nr_Cep = "88888888") OR (Nr_Cep = "99999999") OR (Nr_Cep = "00000000")) then
		RETURN 0;
	else
		return 1;
	end if;
        
    WHILE (LENgth(Nr_Cep) > 0) do
        SELECT LENgth(Nr_Cep) into tamanho;
        select LEFT(Nr_Cep,1) into chr;
        
        -- Verifica se o número informado possui apenas números
        IF (locate(chr,'0123456789') = 0) then
            RETURN 0;
        END if;
        
        SET Nr_Cep = right(Nr_Cep,length(Nr_Cep)-1); -- retira o primeiro dígito
        
    END while;
    
END$$

CREATE DEFINER=`skybots`@`localhost` FUNCTION `function_valida_cnpj` (`CNPJ` VARCHAR(14)) RETURNS BIT(1) BEGIN
-- Finalidade..............: Function para validar o numero do CNPJ
-- OBS.....................: A entrada é um varchar e o retorno é um bit, 1 para válido, 0 para inválido
    DECLARE
        INDICE ,
        SOMA ,
        DIG1 ,
        DIG2 ,
        VAR1 ,
        VAR2 INT;
        declare 
        RESULTADO bit(1);
 

    SET SOMA = 0;
    SET INDICE = 1;
    SET RESULTADO = 0;
    SET VAR1 = 5; /* 1a Parte do Algoritmo começando de "5" */

	if(length(cnpj) != 14) then
		set resultado = 0;
	else
		WHILE ( INDICE <= 4 ) do
		
				SET SOMA = SOMA + CAST(SUBSTRING(cnpj, INDICE, 1) AS UNSIGNED) * VAR1;
				SET INDICE = INDICE + 1; /* Navegando um-a-um até < = 4, as quatro primeira posições */
				SET VAR1 = VAR1 - 1  ;     /* subtraindo o algorítimo de 5 até 2 */
		END while;

		   
		SET VAR2 = 9;
		WHILE ( INDICE <= 12 ) do
			
				SET SOMA = SOMA + CAST(SUBSTRING(cnpj, INDICE, 1) AS UNSIGNED) * VAR2;
				SET INDICE = INDICE + 1;
				SET VAR2 = VAR2 - 1         ;   
			END while;

		SET DIG1 = ( SOMA % 11 );


	   /* SE O RESTO DA DIVISÃO FOR < 2, O DIGITO = 0 */
		IF (DIG1 < 2) then
			SET DIG1 = 0;
		ELSE /* SE O RESTO DA DIVISÃO NÃO FOR < 2*/
			SET DIG1 = 11 - ( SOMA % 11 );
		end if;

		SET INDICE = 1;
		SET SOMA = 0;
		SET VAR1 = 6 ;/* 2a Parte do Algorítimo começando de "6" */
		SET RESULTADO = 0;


		WHILE ( INDICE <= 5 ) do
			
				SET SOMA = SOMA + CAST(SUBSTRING(cnpj, INDICE, 1) AS UNSIGNED) * VAR1;
				SET INDICE = INDICE + 1; /* Navegando um-a-um até < = 5, as quatro primeira posições */
				SET VAR1 = VAR1 - 1  ;     /* subtraindo o algorítimo de 6 até 2 */
			END while;



		/* CÁLCULO DA 2ª PARTE DO ALGORÍTIOM 98765432 */
		SET VAR2 = 9;
		WHILE ( INDICE <= 13 ) do
			
				SET SOMA = SOMA + CAST(SUBSTRING(cnpj, INDICE, 1) AS UNSIGNED) * VAR2;
				SET INDICE = INDICE + 1;
				SET VAR2 = VAR2 - 1            ;
			END while;

	 
		SET DIG2 = ( SOMA % 11 );

	 
	   /* SE O RESTO DA DIVISÃO FOR < 2, O DIGITO = 0 */

		IF (DIG2 < 2) then
			SET DIG2 = 0;

		ELSE /* SE O RESTO DA DIVISÃO NÃO FOR < 2*/
			SET DIG2 = 11 - ( SOMA % 11 );
		end if;

		IF ( DIG1 = SUBSTRING(CNPJ, LENgth(CNPJ) - 1, 1) ) AND ( DIG2 = SUBSTRING(CNPJ, LENgth(CNPJ), 1) ) then
			SET RESULTADO = 1;
		ELSE
			SET RESULTADO = 0;

		end if;
	end if;
 
    RETURN RESULTADO;
 

END$$

CREATE DEFINER=`skybots`@`localhost` FUNCTION `function_valida_cpf` (`CPF` VARCHAR(11)) RETURNS BIT(1) BEGIN 
-- Finalidade..............: Function para validar o numero do CPF
-- OBS.....................: A entrada é um varchar e o retorno é um bit, 1 para válido, 0 para inválido
	DECLARE INDICE, SOMA, DIG1, DIG2 INT; 
    
	/* Calculo do digito 1 */ 
	SET INDICE = 1; 
	SET SOMA = 0; 

	
	if(length(cpf) != 11) then
		return 0;
    end if;
	WHILE (INDICE <= 9) DO 
		SET SOMA = SOMA + CAST(SUBSTRING(CPF, INDICE, 1) AS UNSIGNED) * (11 - INDICE); 
		SET INDICE = INDICE + 1; 
	END WHILE; 
	SET DIG1 = 11 - (SOMA % 11); 
	IF DIG1 > 9 THEN 
		SET DIG1 = 0; 
	END IF; 
    
	/* Calculo do digito 2 */ 
	SET INDICE = 1; 
	SET SOMA = 0; 
    
	WHILE (INDICE <= 10) DO 
		SET SOMA = SOMA + CAST(SUBSTRING(CPF, INDICE, 1) AS UNSIGNED) * (12 - INDICE); 
		SET INDICE = INDICE + 1; 
	END WHILE; 
    
	SET DIG2 = 11 - (SOMA % 11); 
	IF DIG2 > 9 THEN 
		SET DIG2 = 0; 
	END IF; 
    
	/* Validando */ 
	IF ((DIG1 = SUBSTRING(CPF, LENGTH(CPF)-1, 1)) AND (DIG2 = SUBSTRING(CPF, LENGTH(CPF), 1)) AND NOT((CPF = "11111111111") OR (CPF = "22222222222") OR (CPF = "33333333333") OR (CPF = "44444444444") OR (CPF = "55555555555") OR (CPF = "66666666666") OR (CPF = "77777777777") OR (CPF = "88888888888") OR (CPF = "99999999999") OR (CPF = "00000000000")) ) THEN 
    -- válido
		RETURN 1; 
	ELSE 
    -- inválido
		RETURN 0; 
	END IF; 
END$$

CREATE DEFINER=`skybots`@`localhost` FUNCTION `function_valida_email` (`email` VARCHAR(400)) RETURNS BIT(1) BEGIN
-- Finalidade..............: Function para validar o email no formato email@email.com
-- OBS.....................: A entrada é um varchar e o retorno é um bit, 1 para válido, 0 para inválido

	DECLARE Retorno BIT default 1;
		
	if(email NOT REGEXP '^[A-Z0-9._%-]+@[A-Z0-9.-]+.[A-Z]{2,4}$') then
			set retorno = 0;
	END IF;
    return retorno;

END$$

