CREATE DEFINER=`skybots`@`localhost` FUNCTION `function_valida_uf` (`uf` VARCHAR(2)) RETURNS BIT(1) BEGIN
-- Finalidade..............: Function para validar UF existente 
-- OBS.....................: A entrada é um varchar e o retorno é um bit, 1 para válido, 0 para inválido
	

	declare retorno bit(1) default 0;
	
    select count(skybots_gerencia.uf.codigo_uf) into retorno 
    from skybots_gerencia.uf	
    where codigo_uf = uf    
    group by codigo_uf;

    return retorno;
  
END$$

