INSERT INTO `ia_palavras_chave` (`codigo_ia_palavras_chave`, `nome_ia_palavras_chave`, `script_ia_palavras_chave`, `resposta_ia_palavras_chave`, `gerente_ia_palavras_chave`, `tipo_ia_palavras_chave`, `ativo_ia_palavras_chave`) VALUES
(13, 'tamanho', NULL, 'Os tamanhos que possuímos são: @tamanhos.', 1, 1, 1),
(14, 'tamanhos', NULL, NULL, 1, 1, 1),
(15, '@bebida', 'SELECT descricao_bebida , \"R$\", preco_bebida FROM `bebida` WHERE `pizzaria_bebida` = @codigo_pizzaria and ativo_bebida =1', NULL, 2, 0, 1),
(17, 'cardapio', NULL, 'Aqui nosso cardápio: @cardapio', 2, 1, 1),
(18, '@localizacao_pizzaria', 'SELECT \"Endereço\",`endereco_pizzaria` , \"url maps\", complemento_endereco_pizzaria FROM `pizzaria` WHERE `codigo_pizzaria` = 1', NULL, 2, 0, 1),
(19, '@taxa_entrega_media', 'SELECT round(avg(`preco_taxa_entrega`)) FROM `taxa_entrega` WHERE pizzaria_taxa_entrega = @codigo_pizzaria AND `ativo_taxa_entrega` = 1', NULL, 2, 0, 1),
(20, '@formas_de_pagamento', 'SELECT `descricao_forma_pagamento` FROM `forma_pagamento` WHERE `pizzaria_forma_pagamento` = @codigo_pizzaria and `ativo_forma_pagamento` = 1', NULL, 2, 0, 1),
(21, 'Forma de pagamento', NULL, 'Possuímos as seguintes formas de pagamento: @formas_de_pagamento.', 2, 1, 1),
(22, 'Taxa de entrega', NULL, 'Dependendo do bairro a taxa de entrega custa aproximadamente R$ @taxa_entrega_media.00', 2, 1, 1),
(23, '@quantidade_fatias', 'SELECT `descricao_tamanho_pizza`, \"quantidade de fatias \",`quantidade_fatias_tamanho_pizza` FROM `tamanho_pizza` WHERE `pizzaria_tamanho_pizza` = @codigo_pizzaria and `ativo_tamanho_pizza` = 1', NULL, 2, 0, 1),
(24, '@sabores', 'SELECT descricao_sabor_pizza FROM `sabor_pizza` WHERE `pizzaria_sabor_pizza` = @codigo_pizzaria and ativo_sabor_pizza=1', NULL, 2, 0, 1);
